  <script type="text/javascript" id="gwd-init-code">
    (function() {
      document.body.style.opacity = "0";
      var pageDeck = document.getElementById('pagedeck');
      /**
       * Handles the DOMContentLoaded event. The DOMContentLoaded event is
       * fired when the document has been completely loaded and parsed.
       */

      function handleDomContentLoaded(event) {}

      /**
       * Handles the WebComponentsReady event. This event is fired when all
       * custom elements have been registered and upgraded.
       */
      function handleWebComponentsReady(event) {
        document.body.style.opacity = "";
        requestAnimationFrame(function() {
          setTimeout(function() {
            pageDeck.goToPage(pageDeck.getDefaultPage().id);
          }, 1);
        });
      }

      window.addEventListener('DOMContentLoaded',
        handleDomContentLoaded, false);
      window.addEventListener('WebComponentsReady',
        handleWebComponentsReady, false);
    })();
  </script>
  <script>
    var btnResult = document.getElementById('btnResult');
    var ResultField = document.getElementById('ResultField');
    var inputFild = document.getElementsByTagName('input');
    btnResult.addEventListener('click', function() {
      let resultedInputs = document.querySelectorAll("input[type='radio']:checked");
      let result = 0;
      Array.prototype.map.call(resultedInputs, (el) => {
        result += parseInt(el.dataset.value);
      });
      /*console.log(result + ' points');*/
      localStorage.setItem('Result', result + ' points');
      ResultField.innerHTML = result + ' points'
    });
  </script>
  <script>
    const draggable_list = document.getElementById('draggable-list');
    const check = document.getElementById('check');

    const richestPeople = [
      'Бронхолегочная инфекция',
      'Осложненная инфекция мочевыводящих путей',
      'Лечение послеродовой инфекции',
      'Внебольничная пневмония',
      'Инфекция кожи и мягких тканей',

    ];

    // Store listitems
    const listItems = [];

    let dragStartIndex;

    createList();

    // Insert list items into DOM
    function createList() {
      [...richestPeople]
      .map(a => ({
          value: a,
          sort: Math.random()
        }))
        .sort((a, b) => a.sort - b.sort)
        .map(a => a.value)
        .forEach((person, index) => {
          const listItem = document.createElement('li');

          listItem.setAttribute('data-index', index);

          listItem.innerHTML = `
        <span class="number">${index + 1}</span>
        <div class="draggable" draggable="true">
          <p class="person-name">${person}</p>
          <i class="fas fa-grip-lines"></i>
        </div>
      `;

          listItems.push(listItem);

          draggable_list.appendChild(listItem);
        });

      addEventListeners();
    }

    function dragStart() {
      // console.log('Event: ', 'dragstart');
      dragStartIndex = +this.closest('li').getAttribute('data-index');
    }

    function dragEnter() {
      // console.log('Event: ', 'dragenter');
      this.classList.add('over');
    }

    function dragLeave() {
      // console.log('Event: ', 'dragleave');
      this.classList.remove('over');
    }

    function dragOver(e) {
      // console.log('Event: ', 'dragover');
      e.preventDefault();
    }

    function dragDrop() {
      // console.log('Event: ', 'drop');
      const dragEndIndex = +this.getAttribute('data-index');
      swapItems(dragStartIndex, dragEndIndex);

      this.classList.remove('over');
    }

    // Swap list items that are drag and drop
    function swapItems(fromIndex, toIndex) {
      const itemOne = listItems[fromIndex].querySelector('.draggable');
      const itemTwo = listItems[toIndex].querySelector('.draggable');

      listItems[fromIndex].appendChild(itemTwo);
      listItems[toIndex].appendChild(itemOne);
    }

    // Check the order of list items
    function checkOrder() {
      listItems.forEach((listItem, index) => {
        const personName = listItem.querySelector('.draggable').innerText.trim();

        if (personName !== richestPeople[index]) {
          listItem.classList.add('wrong');
        } else {
          listItem.classList.remove('wrong');
          listItem.classList.add('right');
        }
      });
    }

    function addEventListeners() {
      const draggables = document.querySelectorAll('.draggable');
      const dragListItems = document.querySelectorAll('.draggable-list li');

      draggables.forEach(draggable => {
        draggable.addEventListener('dragstart', dragStart);
      });

      dragListItems.forEach(item => {
        item.addEventListener('dragover', dragOver);
        item.addEventListener('drop', dragDrop);
        item.addEventListener('dragenter', dragEnter);
        item.addEventListener('dragleave', dragLeave);
      });
    }

    check.addEventListener('click', checkOrder);
  </script>
